public static void cleanup(String action,
                           FileSystem fileSystem,
                           String cleanupPath) {
  noteAction(action);
  try {
    if (fileSystem != null) {
      fileSystem.delete(new Path(cleanupPath).makeQualified(fileSystem),
                        true);
    }
  } catch (Exception e) {
    LOG.error("Error deleting in "+ action + " - "  + cleanupPath + ": " + e, e);
  }
}
